    const {fetchActeurs} = useContext(BreakContexte)

    useEffect(() => {
        fetchActeurs()
    }, [])
  return (
    <div className='bg-black text-white py-10 px-6'>
        Acteurs   vcxxxxxxxxx
        <Cursor />
    </div>
  )
}

export default Acteurs
